    render() {
        return(
            <div className="Learn"
                style={{
                    position: 'absolute',
                    backgroundImage: 'url('+MouseIcon+')',
                    backgroundSize: "cover",
                    height: "100px",
                    width: "200px" 
              }}>

              </div>
        );
    }
}

export default LearnMore;
